import './App.css';
import Header from './modules/Header';
import Content from './modules/Content';
import Footer from './modules/Footer';
import Additional from './modules/Additional';


function App() {
  return (
    <div className="App">
      <header className="App-header">
         <Header />
         <Content />
         <Footer />
         <Additional />
      </header>
    </div>
  );
}



export default App;
